import React from "react";
import { View, Text } from "react-native";


export default function aluno(){
    return(
        <View>
            <Text><a>Olá, sou Iago Fernandes,</a> Tenho 23 anos, atualmente 
                estou residindo em Senador Pompeu e curso Design Digital
                Pela UFC campus Quixadá.
            </Text>


        </View>
    )
}
